import React from 'react';
import CustomButton from '../custom-button/custom-button.component';
import { BannerContainer, BannerTextBackgroundGreen, BannerTextBackgroundYellow, BannerTextBackgroundRed, BannerText } from './banner.styles';

const Banner = () => {

  return (


  <BannerContainer>
    <BannerTextBackgroundRed>
      <BannerText></BannerText>
    </BannerTextBackgroundRed>
    <BannerTextBackgroundYellow>
      <BannerText></BannerText>
    </BannerTextBackgroundYellow>
    <BannerTextBackgroundGreen>
      <BannerText>Get a free master or repair</BannerText>
      <CustomButton>Subscribe Today!</CustomButton>
        <div id="mc_embed_signup">
          <form action="https://gmail.us7.list-manage.com/subscribe/post?u=daea54b2881619a66ef815217&amp;id=53f71ba6a2" method="post" id="mc-embedded-subscribe-form" name="mc-embedded-subscribe-form" class="validate" target="_blank" novalidate>
            <div id="mc_embed_signup_scroll">
              <h2>Subscribe</h2>
              <div class="indicates-required"><span class="asterisk">*</span> indicates required</div>
            </div>
          </form>
        </div>
    </BannerTextBackgroundGreen>
  </BannerContainer>
  )
};

export default React.memo(Banner);
